function showAlertWithValues() {
    // Get the values from the input fields by their IDs
    const purchasemonth = document.getElementById('kauf_monat').value;
    const purchaseyear = document.getElementById('kauf_jahr').value;
    const purchaseprice = document.getElementById('kaufpreis').value;

    const valueaddinginvestments = document.getElementById('investitionen').value;
    const estimatedsellingprice = document.getElementById('verkaufspreis').value;

    const salescosts = document.getElementById('verkaufskosten').value;

    const propertygaintax = document.getElementById('kalkulierte-steuern').value;
    const taxrate = document.getElementById('kalkulierter-steuersatz').value;

    const ownsproperty = document.getElementById('eigentuemer').value;
    const zipcity = document.getElementById('plz_ort_custom').value;
    
    

    
    


    // Check if the toggle is checked
    const togglefirst = document.getElementById('mit_einlage');
    const togglesecond = document.getElementById('selbstbewohnt');
    const togglethird = document.getElementById('aufschub_gewinnsteuer');
    const togglefourth = document.getElementById('renditeobjekt');
    const togglefive = document.getElementById('aufschub_frueher');

    
    const toggleCheckedfirst = togglefirst.checked;
    const toggleCheckedsecond = togglesecond.checked;
    const toggleCheckedthird = togglethird.checked;
    const toggleCheckedfourth = togglefourth.checked;
    const toggleCheckedfive = togglefive.checked;

    // Variable to store the label text if toggle is checked
    let labelTextfirst = '';
    let labelTextsecond = '';
    let labelTextthird = '';
    let labelTextfourth = '';
    let labelTextfive = '';


    if (toggleCheckedfirst) {
        // Get the label's text content for the toggle
        const labelfirst = document.querySelector('label[for="mit_einlage"]');
        labelTextfirst = labelfirst.textContent || labelfirst.innerText;
    }
    if (toggleCheckedsecond) {
        // Get the label's text content for the toggle
        const labelsecond = document.querySelector('label[for="selbstbewohnt"]');
        labelTextsecond = labelsecond.textContent || labelsecond.innerText;
    }
    if (toggleCheckedthird) {
        // Get the label's text content for the toggle
        const labelthird = document.querySelector('label[for="aufschub_gewinnsteuer"]');
        labelTextthird = labelthird.textContent || labelthird.innerText;
    }
    if (toggleCheckedfourth) {
        // Get the label's text content for the toggle
        const labelfourth = document.querySelector('label[for="renditeobjekt"]');
        labelTextfourth = labelfourth.textContent || labelfourth.innerText;
    }
    if (toggleCheckedfive) {
        // Get the label's text content for the toggle
        const labelfive = document.querySelector('label[for="aufschub_frueher"]');
        labelTextfive = labelfive.textContent || labelfive.innerText;
    }

    // Create the alert message including the toggle status and label text (if checked)
    const alertMessage = `Purchase Month: ${purchasemonth}\nPurchase Year: ${purchaseyear}\nPurchase price: ${purchaseprice}\nLabel: ${labelTextfirst}\nValueaddinginvestment: ${valueaddinginvestments}\nestimatedsellingprice: ${estimatedsellingprice}\nsalescosts: ${salescosts}\npropertygaintax: ${propertygaintax}\ntaxrate: ${taxrate}\nownsproperty: ${ownsproperty}\nzipcity: ${zipcity}`;

    // Show the alert with the values and toggle status
    alert(alertMessage);

    // Set the values to the hidden input fields
    document.getElementById('purchasemonth').value = purchasemonth;
    document.getElementById('purchaseyear').value = purchaseyear;
    document.getElementById('purchaseprice').value = purchaseprice;

    document.getElementById('valueaddinginvestments').value = valueaddinginvestments;
    document.getElementById('estimatedsellingprice').value = estimatedsellingprice;
    document.getElementById('salescosts').value = salescosts;

    document.getElementById('propertygaintax').value = propertygaintax;
    document.getElementById('taxrate').value = taxrate;

    document.getElementById('ownsproperty').value = ownsproperty;
    document.getElementById('zipcity').value = zipcity;

    // Set the label text to a hidden input only if the toggle is checked
    if (toggleCheckedfirst || toggleCheckedsecond || toggleCheckedthird || toggleCheckedfourth || toggleCheckedfive) {
        document.getElementById('hiddenToggleLabel').value = labelTextfirst;
        document.getElementById('hiddenToggleLabe2').value = labelTextsecond;
        document.getElementById('hiddenToggleLabe3').value = labelTextthird;
        document.getElementById('hiddenToggleLabe4').value = labelTextfourth;
        document.getElementById('hiddenToggleLabe5').value = labelTextfive;
    } else {
        document.getElementById('hiddenToggleLabel').value = '';
        document.getElementById('hiddenToggleLabe2').value = '';
        document.getElementById('hiddenToggleLabe3').value = '';
        document.getElementById('hiddenToggleLabe4').value = '';
        document.getElementById('hiddenToggleLabe5').value = '';
    }
}


